'react-router-dom';
import Checkout from './Checkout.js'
function App() {
  return (
  	<Router>
    <div className="App">
    	<Header/>
      <Switch>
      <Route path="/login">

        <Login/>
        </Route>
      	<Route path="/checkout">

     		<Checkout/>
      	</Route>
      	<Route path="/">

     		<Home />
      	</Route>

      </Switch>

    </div>
    </Router>
  );
}

export default App;
